import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import VegetableDetection from "./VegetableDetection";
import PacketDetection from "./PacketDetection";
import GetForecasting from "./pages/GetForecasting"; // Make sure this path matches your structure

function App() {
  return (
    <Router>
      <div>
        <nav style={navStyle}>
          <ul>
            <li>
              <Link to="/vegetable-detection">Vegetable Detection</Link>
            </li>
            <li>
              <Link to="/packet-detection">Packet Detection</Link>
            </li>
            <li>
              <Link to="/get-forecasting">Get Forecasting</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/vegetable-detection" element={<VegetableDetection />} />
          <Route path="/packet-detection" element={<PacketDetection />} />
          <Route path="/get-forecasting" element={<GetForecasting />} />
        </Routes>
      </div>
    </Router>
  );
}

// Simple style for navigation
const navStyle = {
  backgroundColor: "#f0f0f0",
  padding: "10px",
  marginBottom: "20px",
};

export default App;
